exports=async function(bid,options){const{parseCatalog}=await require("transcode/parse_catalog"),url=`http://www.newbiquge.com/book${bid.startsWith("s")?"s":""}/${bid.replace("s","")}.html`;return parseCatalog(url,"div#list>dl>dd",{clientOptions:{...(options&&options.clientOptions),encoding:"gbk"}})};